    //region 文件上传和下载
    @RequestMapping("/uploadFjxxFile")
    public ResponseEntity<BaseResultModel> uploadFjxxFile(HttpServletRequest request, BaseQueryModel queryModel) {
        BaseResultModel baseResultModel = new BaseResultModel();
        DataService dataService = this.getDataService();
        DataContext dataContext = dataService.getDataContext(druidConfig);
        SessionModel sessionModel = (SessionModel) request.getSession().getAttribute("SessionModel");

        MultipartRequest multipartRequest = getMultipartRequest(request);
        Collection<List<MultipartFile>> multifiles = multipartRequest.getMultiFileMap().values();

        List<MultipartFile> files=new ArrayList<>();
        for(List<MultipartFile> temp:multifiles)
            files.addAll(temp);

        if (files == null || files.size() <= 0)
        {
            baseResultModel.setSuccess(false);
            baseResultModel.setMsg("参数有误");
            return new ResponseEntity<>(baseResultModel, HttpStatus.OK);
        }

        try {
            for (MultipartFile file : files) {
                String dt = Utility.formatDateTime(new Date(), true);
                int hour = Calendar.getInstance().get(Calendar.HOUR_OF_DAY);
                String dpath = Utility.Path_Combine(sysProperties.getDocs(), "MainStorage" + File.separator + "DocumentFile" + File.separator+dt + File.separator + hour + File.separator);
                if (!Utility.File_Exists(dpath))
                    Utility.File_Mkdirs(dpath);

                String oldName = file.getOriginalFilename();//原文件名
                String prefix = oldName.substring(oldName.lastIndexOf("."));//文件类型
                String attachementId = Utility.createUniqueId() + prefix;//newName
                File source=new File(dpath + attachementId);
                file.transferTo(source);


                String opath =  Utility.Path_Combine(sysProperties.getDocs(), "MainStorage" + File.separator + "DocumentFile" + File.separator);
                File dest=new File(opath + attachementId);
                Files.copy(source.toPath(),dest.toPath());

                baseResultModel.setSuccess(true);
                baseResultModel.setTag(attachementId);

                TXtGyFjxxDao fjxxDao = new TXtGyFjxxDao(dataContext);
                TXtGyFjxxModel model=new TXtGyFjxxModel();
                model.setfj_xh(attachementId);
                model.setfj_mc(oldName);
                model.setfj_wz(prefix);
                model.setfj_lj(dpath + attachementId);
                model.setsfyx_bj(1);
                model.setlr_sj(new Date());
                model.setlrry_xh(sessionModel!=null?sessionModel.getUserId():null);
                model.setcgsc_sj(model.getlr_sj());
                fjxxDao.insertOnSubmit(model);
                break;
            }
            return new ResponseEntity<>(baseResultModel, HttpStatus.OK);
        } catch (Exception e) {
            e.printStackTrace();
            logger.error(e.getMessage());
        }
        return new ResponseEntity<>(baseResultModel, HttpStatus.OK);
    }

    @RequestMapping("/downloadFjxxFile")
    public ModelAndView downloadFjxxFile(HttpServletResponse response, HttpServletRequest request,TXtGyFjxxModel model, boolean isImage, boolean isThumbImage) throws Exception {
        DataService dataService = this.getDataService();
        DataContext dataContext = dataService.getDataContext(druidConfig);
        String attachment_id = model.getfj_xh();
        if (Utility.isNullOrEmpty(attachment_id)) return null;

        String opath =  Utility.Path_Combine(sysProperties.getDocs(), "MainStorage" + File.separator + "DocumentFile" + File.separator);

        TXtGyFjxxDao fjxxDao = new TXtGyFjxxDao(dataContext);
        String sql_where = Utility.String_Format(" fj_xh='{0}'", attachment_id);
        List<BaseModel> baseModels = fjxxDao.findAll(sql_where);
        TXtGyFjxxModel fjxx=null;
        String targetPath=null;
        if(baseModels.size()>0)
            fjxx=(TXtGyFjxxModel)baseModels.get(0);

        String fj_mc = new String(model.getfj_mc().getBytes("iso-8859-1"), "utf-8");
        if (fjxx != null) {
            fj_mc = fjxx.getfj_mc();
//            targetPath=fjxx.getfj_lj();
            targetPath=opath+attachment_id;
        }
        if (Utility.isNullOrEmpty(fj_mc)) {
            fj_mc = attachment_id;
        }

        HttpHeaders headers = new HttpHeaders();
        //头部设置文件类型
        headers.setContentDispositionFormData("attachment", fj_mc);
        headers.setContentType(MediaType.APPLICATION_OCTET_STREAM);

        String fileExt = this.getFileExtById(attachment_id);
        File file = new File(targetPath);
        if (file.exists())
            return this.file(response,request,targetPath, HttpContentTypes.GetMimeType(fileExt), fj_mc);

        //未找到对应文件，不管是文件还是图片直接显示不存在图片
        if (_NotFoundImageBytes == null) {
            initNonFoundImageBytes();
        }
        return this.file(response,request,_NotFoundImageBytes, HttpContentTypes.Image_Jpeg, fj_mc);
    }



