    public void fillQueryModel4Crop(DataContext dataContext,BaseQueryModel queryModel,SessionModel sessionModel){
        //归属企业查询
        String sql="select * from t_data_enterprise_2_user where user_id=? and is_valid=1";
        TDataEnterprise2UserDao userDao=new TDataEnterprise2UserDao(dataContext);
        List<BaseModel> models=userDao.queryAll(sql,sessionModel.getUserId());
        if(models.size()>0){
            TDataEnterprise2UserModel userModel=(TDataEnterprise2UserModel) models.get(0);
            queryModel.setEnterprise_id(userModel.getenterprise_id());
        }
    }
    public String getEnterpriseId2User(DataContext dataContext,SessionModel sessionModel){
        //归属企业查询
        String sql="select * from t_data_enterprise_2_user where user_id=? and is_valid=1";
        TDataEnterprise2UserDao userDao=new TDataEnterprise2UserDao(dataContext);
        List<BaseModel> models=userDao.queryAll(sql,sessionModel.getUserId());
        if(models.size()>0){
            TDataEnterprise2UserModel userModel=(TDataEnterprise2UserModel) models.get(0);
            return userModel.getenterprise_id();
        }
        return null;
    }
    /**
     * 校验密码
     *
     * @param pwd    用户输入的密码
     * @param pwd_db 数据库中的加密
     * @param salt   偏移值
     * @return
     */
    protected boolean checkPwd(String pwd, String pwd_db, String salt) {
        String md5String = Utility.getMD5String(pwd + salt);
        return !Utility.isNullOrEmpty(md5String) && md5String.equals(pwd_db);
    }


    protected boolean chkPassword(String pwd, String pwd_db) {
        String md5String = Utility.getMD5String(pwd);
        return !Utility.isNullOrEmpty(md5String) && md5String.equals(pwd_db);
    }

    protected SessionModel getSessionModel(HttpServletRequest request){
        SessionModel sessionModel = null;
        if(!StringUtils.isEmpty(request.getSession().getAttribute("SessionModel"))) {
            try {
                sessionModel= (SessionModel)request.getSession().getAttribute("SessionModel");
            }catch (Exception e){

            }
            if(sessionModel==null)
                sessionModel= gson.fromJson(request.getSession().getAttribute("SessionModel").toString(), SessionModel.class);
            sessionModel.setLogin(true);
        }else {
            sessionModel=new SessionModel();
        }
        return sessionModel;
    }


    protected SessionModel ChkLogin(HttpServletRequest request){
        SessionModel sessionModel = null;
        if(!StringUtils.isEmpty(request.getSession().getAttribute("SessionModel"))) {
            try {
                sessionModel= (SessionModel)request.getSession().getAttribute("SessionModel");
            }catch (Exception e){

            }
            if(sessionModel==null)
                sessionModel= gson.fromJson(request.getSession().getAttribute("SessionModel").toString(), SessionModel.class);
            sessionModel.setLogin(true);
        }else {
            sessionModel=new SessionModel();
            sessionModel.setLogin(false);
        }
        return sessionModel;
    }

    protected PagingOptions getPagingOptions(HttpServletRequest request){
        PagingOptions options=new PagingOptions();
        String page=request.getParameter("page");
        String pageSize=request.getParameter("pageSize");
        options.setPage(Integer.parseInt(page));
        options.setPageSize(Integer.parseInt(pageSize));
        return options;
    }


    /**
     * 跳转到指定的action和controller，并带入相关的参数
     *
     * @param action
     * @param controllerName
     * @param routeValues
     * @return
     */
    protected ModelAndView redirect(String action, String controllerName, Map<String, Object> routeValues) {
        return redirectTo(UrlHelper.GenerateUrl(null, action, controllerName, routeValues, true));
    }

    /**
     * 跳转到指定的action和controller，并带入相关的参数
     *
     * @param action
     * @param controllerName
     * @return
     */
    protected ModelAndView redirect(String action, String controllerName) {
        return redirectTo(UrlHelper.GenerateUrl(null, action, controllerName, null, true));
    }

    /**
     * 跳转到指定的url
     *
     * @param url
     * @return
     */
    protected ModelAndView redirectTo(String url) {
        if (!Utility.isNullOrEmpty(url) && url.startsWith(SystemSetting.Path_System_StartUrl))
            url = '/' + url.substring(SystemSetting.Path_System_StartUrl.length());
        ModelAndView mv = new ModelAndView("redirect:" + url);
        return mv;
    }

    /**
     * 返回一个视图界面
     *
     * @return
     */
    protected ModelAndView view(String controller, String action) {
        return view(controller,action,null, null);
    }

    /**
     * 返回一个视图界面
     *
     * @return
     */
    protected ModelAndView view(String controller, String action, String viewName) {
        return view(controller,action,viewName, null);
    }

    /**
     * 如果viewName为空，则自动根据ControllerName和ViewName计算得到View
     *
     * @param viewName
     * @param model
     * @return
     */
    protected ModelAndView view(String controller, String action, String viewName, Object model) {
        if (Utility.isNullOrEmpty(viewName)) {
            viewName =controller + "/" + action;
        } else if (viewName.indexOf('/') < 0) {
            viewName = controller + '/' + viewName;
        }

        if(viewName.charAt(0)=='/') viewName=viewName.substring(1);

        ModelAndView mv = new ModelAndView(viewName);
        Map<String, ?> map = null;
        if (model instanceof Map) map = (Map<String, ?>) model;
        if (map != null) mv.addAllObjects(map);
        else if (model != null) {
            mv.addObject(WeChatFields.Const_ViewData_ViewDataModel, model);
        }
        return mv;
    }


