    public boolean isCertify(Long secretF,Long secretT){
        if (ObjectUtils.isEmpty(secretF)|| ObjectUtils.isEmpty(secretT)){
            return false;
        }else {
            //计算后的值
            long l = secretF * 300 + System.currentTimeMillis();
            Long leftBorder=secretT-10*60*1000;
            Long rightBorder=secretT+10*60*1000;
            if (l>=leftBorder&&l<=rightBorder){
                return true;
            } else {
                return false;
            }
        }
    }


